import './Navigation.css';
import './Body.css';
import { Link } from "react-router-dom";
import Media1 from './Media1';
import Login from './Login';
import { render } from '@testing-library/react';

function Navigation(){
  return(
    <><div className='box'>
      <div className='logo'>LOGO</div>
      <div className='nav'>
        <ul>
          <li><Link to="Body"id='col'>Home</Link></li>
          <li><Link to="Event"id='col'>Event</Link></li>
          <li><a href="media"id='col'>Media</a></li>
          <li><a href="#about us"id='col'>About us</a></li>
          <div className='button nav'id='col'><a href="<Login/>"id='col'>Log in</a></div>
        </ul>
      </div>
    </div>

      </> 
        
  );
}      export default Navigation;
